import java.text.*;

def sql = """select obj.name, 
                    count(prop2.value) 
               from BaseObject     as obj, 
                    BaseObject     as obj2, 
                    StringProperty as prop, 
                    StringProperty as prop2 
              where obj.className='MailArchiveCode.MailTopicClass' 
                    and obj.name<>'MailArchiveCode.MailTopicClassTemplate' 
                    and prop.id=obj.id and prop.name='topicid' 
                    and (obj2.id=prop2.id and obj2.className='MailArchiveCode.MailClass' 
                         and obj2.name<>'MailArchiveCode.MailClassTemplate' and prop2.name='topicid' 
                         and prop.value=prop2.value) 
                    and not exists(select prop3.id
                                     from StringProperty prop3 
                                    where prop3.id=obj.id and prop3.name='sensitivity' 
                                          and (prop3.value in ('Personal', 'Confidential', 'Private')) 
                                  )
              group by obj.name"""
def topics = xwiki.search(sql)
def topicMap = [:]
def newsletterMap = [:]

// formatter for parsing dates
def parser = new SimpleDateFormat("EEE, dd MMM yyyy HH:mm:ss ZZZZZ")
// formatter for formatting dates for display
def formatter = new SimpleDateFormat("yyyy/MM/dd HH:mm")
topics.each { item ->
  def topic = item[0]
  def count = item[1]
  def topicdoc = xwiki.getDocument(topic)
  def topicobj = topicdoc.getObject('MailArchiveCode.MailTopicClass')
  def lastupdatedate = topicobj.lastupdatedate 
  if (lastupdatedate != null && lastupdatedate != "")
  {
    lastupdatedate = parser.parse(topicobj.lastupdatedate )
  } else
  {
    // Put a very old date if date could not be found in message
    lastupdatedate = new Date()
    lastupdatedate .setTime(0)
  }

  if (topicobj.type.equalsIgnoreCase("Mail")) {
    // Adding a new mail entry
    topicMap[lastupdatedate] = [topic, topicobj, count]
  } else if (topicobj.type.equalsIgnoreCase("Newsletter")) {
    // Adding a new newsletter entry  
    newsletterMap[lastupdatedate] = [topic, topicobj]
  }
}

// Showing mailing-lists entries
println("== Mailing-lists Entries ==")

println("{{html wiki='true'}}")
println("""
<table id="mailstable" class="grid sortable filterable doOddEven">
  <tr class="sortHeader">
    <th style="background-color:black">Subject</th>
    <th style="background-color:black">Messages</th>
    <th style="background-color:black">Author</th>
    <th style="background-color:black">Created</th>
    <th style="background-color:black">Updated</th>
  </tr>
""")
topicMap = [:].putAll(topicMap.entrySet().sort{it.key}.reverse())
showMapTable(topicMap, parser, formatter, "Mail")
println("</table>{{/html}}")
println()

// Showing newsletters entries
println("== Community Newsletters ==")
println("{{html wiki='true'}}")
println("""
<table id="newsletterstable" class="grid sortable filterable doOddEven">
  <tr class="sortHeader">
    <th style="background-color:black">Subject</th>
    <th style="background-color:black">Author</th>
    <th style="background-color:black">Posted</th>
  </tr>
""")
newsletterMap = [:].putAll(newsletterMap.entrySet().sort{it.key}.reverse())
showMapTable(newsletterMap, parser, formatter, "Newsletter")
println("</table>")
println("{{/html}}")

/* 
   Displays a table with topic entries of type MailArchiveCode.MailClass, 
   using parser and formatter to parse and format dates, respectively 
*/
void showMapTable (map, parser, formatter, type) {

  map.each { topic ->
    def topicobj = topic.value[1]
    def topicname = topic.value[0]
    def replies = topic.value[2]
    def lastupdatedate = topic.key
    def creationdate = topicobj.startdate
    if (creationdate != null && creationdate != "") {
      decodedcreationdate = parser.parse(creationdate)
    } else {
      // Put a very old date if date could not be found in message
      decodedcreationdate = new Date()
      decodedcreationdate.setTime(0)
    }
    def strcreationdate = formatter.format(decodedcreationdate)
    def strlastupdatedate = formatter.format(lastupdatedate)
    def author = topicobj.author
    if (author=="" || author==null) { author="unknown" }
    wikiUser = parseUser(author)
    if (wikiUser == null) 
    { wikiUser = author 
    } else 
    { 
      def prettyName = xwiki.getLocalUserName(wikiUser, false)
      wikiUser = "{{useravatar username='${wikiUser}' width='30'/}} [[${prettyName}>>${wikiUser}]]" 
    }
    def subject = topicobj.getProperty("subject").value
    if (subject.length() > 55) { subject = subject[0..54]+"..." }
    def str = "<tr><td>[[{{{" + subject + "}}}>>"+topicname+"]]</td>"
    // Compute number of replies
    if (type=="Mail") {
      /* def hql = "select count(*) from BaseObject as obj, StringProperty as prop where obj.className='MailArchiveCode.MailClass' and prop.id=obj.id and prop.name='topicid' and prop.value='" + topicobj.topicid + "'"
      def replies = xwiki.search(hql)*/
      str += "<td>" + replies + "</td>"
    }
    str += "<td>(% style='font-size:xx-small' %)${wikiUser}</td><td>(% style='font-size:xx-small' %)${strcreationdate}</td>"

    if (type=="Mail") { str += "<td>(% style='font-size:xx-small' %)${strlastupdatedate}</td>" }
    str += "</tr>"
    println(str)
  }
}

/*
   Parses a user string of the form "user <usermail@com>"
     - extract mail and if matched in xwiki user profiles, returns page name for this profile
     - returns null string if no match is found
*/
String parseUser (user) {
  def start = user.indexOf('<')
  def end = user.indexOf('>')
  def mail = ""
  if (start!=-1 && end != -1) {
    mail = user.substring(start+1, end).toLowerCase()
  }
  if (mail != "") {
    def hql = "select obj.name from BaseObject as obj, StringProperty as prop where obj.className='XWiki.XWikiUsers' and obj.id=prop.id and prop.name='email' and LOWER(prop.value) ='" + mail + "'"

    def wikiuser = xwiki.search(hql)
    return wikiuser[0]

  } else {

    return null;
  }
}


